import { SkillBars } from "react-skills";

const skillsData = [
  {
    name: "ReactJS",
    level: 100,
    color: "blue",
  },
  {
    name: "SomeOtherTech",
    level: 85,
    color: "red",
  },
];

// ...
function Skills() {
  <div className="skills">
    return <SkillBars skills={skillsData} />;
  </div>;
}

export default Skills;
